import styled from 'styled-components'

export const IconSM = styled.span`
  font-size: 16px;
`
export const IconMD = styled.span`
  font-size: 18px;
`
export const IconGray = styled.span`
  display: inline-block;
  font-size: 18px;
  width: 24px;
  height: 24px;
  background: #F5F5F5;
  border-radius: 2px;
  line-height: 24px;
  text-align: center;
  margin: 0 5px;
`
